    const [password, setPassword] = useState('');

    return (<>
        <View style={styles.container}>
            <View style={styles.boxContainer}>
                <Text style={styles.header}>Login</Text>
                <TextInput style={styles.textInput} placeholder="example@mail.com" />
                <TextInput style={styles.textInput} secureTextEntry={true} placeholder="Insert your password" />

                <View style={styles.buttonsContainer}>
                    <Button style={styles.buttonPadding} title="Submit" />
                    <Text style={styles.buttonPadding}>Not registered? Sign up!</Text>
                </View>
            </View>

        </View>
    </>)
}

export default Login;
